import { Row } from "react-bootstrap";
import Product from "./Product";

const ProductList = (props) => {
  return (
    <Row sm={6}>
      {props.products.map((product) => {
        const { id, title, price, image, text } = product;
        return (
          <Product
            key={id}
            title={title}
            image={image}
            text={text}
            price={price}
          />
        );
      })}
    </Row>
  );
};

export default ProductList;
